int set_yyinput(char * buffer, int maxSize)
{
  int n;

  n = (maxSize < (yyStringInputEnd - yyStringInputPointer) ?
       maxSize : (yyStringInputEnd - yyStringInputPointer));
  if (n > 0)
    {
      memcpy(buffer, yyStringInputPointer, n);
      yyStringInputPointer += n;
    }
  return n;
}
